import gal1 from './gal-1.png'
import gal2 from './gal-2.png'
import gal3 from './gal-3.png'

import './Gallery.css';

function Gallery() {
  const links = [
    "https://www.youtube.com/watch?v=imKELSX2kw8",
    "https://www.youtube.com/watch?v=LQGKn2CyUkA",
    "https://youtu.be/RnFjic4xLBY"
  ]
  return (
    <section className="ko-gallery">
      <div className="gallery">
      {
        links.map((link, key) => {
          <div className={`i${key} video-responsive`} key={`video-gallery-${key}`}>
            <iframe
              width="853"
              height="480"
              src={`https://www.youtube.com/embed/imKELSX2kw8`}
              frameBorder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
              title="Embedded youtube"
            />
          </div>
        })
      }

        {/* <img className="i1" src={gal1}/>
        <img className="i2" src={gal2}/>
        <img className="i3" src={gal3}/> */}
      </div>
    </section>
  );
}

export default Gallery;
